import React from 'react';

interface ResultProps {
  score: number;
  totalQuestions: number;
  answeredQuestions: number;
  timeSpent: number;
  onRetry: () => void;
}

const Result: React.FC<ResultProps> = ({ score, totalQuestions, answeredQuestions, timeSpent, onRetry }) => {
  return (
    <div className="text-center space-y-6">
      <h2 className="text-2xl font-bold">Quiz Complete!</h2>
      <p className="text-xl">
        Your score: {score} out of {totalQuestions}
      </p>
      <p className="text-lg">
        Questions answered: {answeredQuestions} | Time spent: {timeSpent}s
      </p>
      <button
        onClick={onRetry}
        className="px-6 py-3 bg-blue-500 text-white rounded-lg hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
      >
        Try Again
      </button>
    </div>
  );
};

export default Result;
